import React from "react";
import "../styles/components/Footer.css";
const Footer = () => {
  return (
    <div className="Footer">
      <h2 className="Footer-title">This is platzi conf</h2>
      <p className="Footer-copy">All Rights reserved. LOL</p>
    </div>
  );
};

export default Footer;
